		public override void OnViewMouseEnter(DslDiagrams::DiagramPointEventArgs pointArgs)
		{
			if (pointArgs  == null) throw new global::System.ArgumentNullException("pointArgs");
		
			DslDiagrams::DiagramView activeView = this.ActiveDiagramView;
			if(activeView != null)
			{
				DslDiagrams::MouseAction action = null;
				if (SelectedToolboxItemSupportsFilterString(activeView, global::ApiStudioIO.ApiStudioIOToolboxHelper.ResourceAssociationFilterString))
				{
					if (this.resourceAssociationConnectAction == null)
					{
						this.resourceAssociationConnectAction = new global::ApiStudioIO.ResourceAssociationConnectAction(this);
						this.resourceAssociationConnectAction.MouseActionDeactivated += new DslDiagrams::MouseAction.MouseActionDeactivatedEventHandler(OnConnectActionDeactivated);
					}
					action = this.resourceAssociationConnectAction;
				} 
				else if (SelectedToolboxItemSupportsFilterString(activeView, global::ApiStudioIO.ApiStudioIOToolboxHelper.HttpApiResourceToolFilterString))
				{
					if (this.httpApiResourceToolConnectAction == null)
					{
						this.httpApiResourceToolConnectAction = new global::ApiStudioIO.HttpApiResourceToolConnectAction(this);
						this.httpApiResourceToolConnectAction.MouseActionDeactivated += new DslDiagrams::MouseAction.MouseActionDeactivatedEventHandler(OnConnectActionDeactivated);
					}
					action = this.httpApiResourceToolConnectAction;
				} 
				else if (SelectedToolboxItemSupportsFilterString(activeView, global::ApiStudioIO.ApiStudioIOToolboxHelper.HttpApiRequestToolFilterString))
				{
					if (this.httpApiRequestToolConnectAction == null)
					{
						this.httpApiRequestToolConnectAction = new global::ApiStudioIO.HttpApiRequestToolConnectAction(this);
						this.httpApiRequestToolConnectAction.MouseActionDeactivated += new DslDiagrams::MouseAction.MouseActionDeactivatedEventHandler(OnConnectActionDeactivated);
					}
